Trouble creating modularized, abstract functions to update mongodb (mongoose) database<p>I am trying to create a modular and abstract group of functions to persist data to my Mongodb (Mongoose) database using Node JS like so: </p>

<pre><code>const mongoose = require('mongoose')
mongoose.connect('xyz123blahblahblah')
const db       = mongoose.connection
const Schema   = mongoose.Schema
const ObjectId = Schema.ObjectId

var doc
var docInstance

// Connect to the database.
function connect() {
    console.log('Establishing a connection.')
    db.on('error', console.error.bind(console, 'Connection error:'))

    db.once('open', function() {
      console.log('Connection established.')
      updateCollection() 
    })
}

function updateCollection(schemaName, schemaObject, schemaProperties) {
    doc         = mongoose.model(schemaName, schemaObject)
    docInstance = new doc(schemaProperties)
}

function save() {
    console.log('Saving document to the collection.')
    docInstance.save(function (err, docInstance) {
        if (err) { return console.error(err) } 
        else { console.log('Document was succesfully added.') }
    })
}
</code></pre>

<p>Now the idea is, later on, I can export these functions and call them sequentially like so:</p>

<pre><code>// Define the Collection model.
const User = new Schema( { name: String, email: String, id: ObjectId} )

connect()
updateCollection('users', User, { name: 'Testy McTest', email: 'test@test.co' })
save()
</code></pre>

<p>It doesn't make sense to me to pass the parameters for the updateCollection() function via the connect() function as these are essentially responsible for two different things more or less, but my updateCollection() function needs to be called INSIDE of my connect() function.</p>

<p>An ideal solution for me would be having the ability to do the following:</p>

<pre><code>// Define the Collection model.
const User = new Schema( { name: String, email: String, id: ObjectId} 

connect(updateCollection('users', User, { name: 'Testy McTest', email: 'test@test.co' }))
save()
</code></pre>

<p>I'm a bit lost now on how to proceed. Would it be possible to construct my  connect() and updateCollection() functions in this way to ensure a separation of concerns? Any help would be much appreciated!</p>

