const User = new Schema( { name: String, email: String, id: ObjectId} )

connect()
updateCollection('users', User, { name: 'Testy McTest', email: 'test@test.co' })
save()
</code></pre>

<p>It doesn't make sense to me to pass the parameters for the updateCollection() function via the connect() function as these are essentially responsible for two different things more or less, but my updateCollection() function needs to be called INSIDE of my connect() function.</p>

<p>An ideal solution for me would be having the ability to do the following:</p>

<pre><code>// Define the Collection model.
const User = new Schema( { name: String, email: String, id: ObjectId} 

connect(updateCollection('users', User, { name: 'Testy McTest', email: 'test@test.co' }))
save()
</code></pre>

<p>I'm a bit lost now on how to proceed. Would it be possible to construct my  connect() and updateCollection() functions in this way to ensure a separation of concerns? Any help would be much appreciated!</p>; Answer: Adding to my "why?". Your `person.sayHi()` is likely doing a `System.out.println("Hello from " + this.name)`. Well, that will construct a `StringBuilder` for the concatenation, and a `String` for the result, and both of them will allocate a char array. This occurs on **every** call to `sayHi`, while the Iterator is only allocated once. In short, the Iterator is nothing.

