<p>I created an <code>array bulkUpdateOperations = []</code> and did the following in a loop:</p>

<pre><code>bulkUpdateOperations.push({
      'updateOne': {
        'filter': {'_id': item.id},
        'update': {$push: {rating: {'rating': item.rating, 'date': Date.now}}}
      }
});
Person.collection.bulkWrite(bulkUpdateOperations, {orderd: true, w: 1}, callbackfunc);
</code></pre>

<p>But nothing gets updated. I get the following response:</p>

<pre><code>...
...
...
